script: |
  super -f text -I q5925.spq | sort > q5925.out

inputs:
  - name: q5925.spq
    data: |
      SELECT DISTINCT - - 59 AS col0 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5925.out
    data: |
      59
